(window.webpackJsonp=window.webpackJsonp||[]).push([[728],{1081:function(n,h,g){"use strict";g.r(h);var i=g(44),t=Object(i.a)({},(function(){var n=this,h=n.$createElement,g=n._self._c||h;return g("ContentSlotsDistributor",{attrs:{"slot-key":n.$parent.slotKey}},[g("h1",{attrs:{id:"chuong-1629-nam-cung-nguyen-phong-đen-truong-gia-【-canh-thu-hai-】"}},[g("a",{staticClass:"header-anchor",attrs:{href:"#chuong-1629-nam-cung-nguyen-phong-đen-truong-gia-【-canh-thu-hai-】"}},[n._v("#")]),n._v(" Chương 1629: Nam Cung Nguyên Phong đến Trương gia 【 canh thứ hai 】")]),n._v(" "),g("hr"),n._v(" "),g("p",[n._v("Chương 1629: Nam Cung Nguyên Phong đến Trương gia "),g("br"),g("br"),n._v("Mọi người khiếp sợ thời gian không dài, Tôn Cường liền cảm thấy bản thân không cần lực lượng cũng có thể bay, sau đó... Sau đó liền biến mất ở chân trời, không thấy tung tích."),g("br"),g("br"),n._v("Thấy Ngột Thần chỉ là để hắn tự do bay lượn, cũng không ra tay độc ác, Trương Huyền thở phào nhẹ nhõm."),g("br"),g("br"),n._v("Cái này hai hàng, ngày ngày suy nghĩ trang bức, nói thật, cũng đã sớm muốn đánh một hồi, cho cái dạy dỗ."),g("br"),g("br"),n._v("Thật không biết bản thân biết điều như vậy một cái chủ nhân, tại sao có thể có như vậy ưa thích trang bức quản gia!"),g("br"),g("br"),n._v("Tuyển người không quen ah!"),g("br"),g("br"),n._v("Xem ra sau này, vẫn là phải tuyển cái đáng tin cậy một chút quản gia mới được, ít nhất cũng phải giống Ngột Thần đồng dạng, rất nhiều chuyện không cần tự mình ra tay, nhẹ nhõm có thể giải quyết, không giống cái tên này, cản trở không nói, còn ngày ngày gây phiền toái..."),g("br"),g("br"),n._v("Suy nghĩ một chút cũng là đủ."),g("br"),g("br"),n._v("“Tộc trưởng, Lạc gia một vị kêu Lạc Thiên Nhai kế nhiệm gia chủ, nghe nói hắn lĩnh ngộ không gian phong cấm chân giải, lần này tới, là muốn đối ngươi khiêu chiến, cho chúng ta Trương gia cái ra oai phủ đầu... Hơn nữa bọn họ, còn mời Danh Sư đường tiến hành dự lễ, muốn cho hắn chủ trì công đạo...”"),g("br"),g("br"),n._v("Đi vào đại điện ngồi xuống, một vị trưởng lão ôm quyền nói."),g("br"),g("br"),n._v("“Cái này...” Trương Huyền xoa xoa mi tâm: “Chuyện này ta biết, lần này trở về, chính là vì xử lý chuyện này mà tới...”"),g("br"),g("br"),n._v("“Phong cấm không gian chân giải, là Lạc gia đỉnh phong nhất tuyệt học, một khi thi triển, không gian đều có thể giam cầm, làm cho không người nào có thể phản kháng, liền xem như chúng ta, muốn phá vỡ, cũng không dễ dàng như vậy... Huyền nhi, ngươi cũng phải cẩn thận!”"),g("br"),g("br"),n._v("Hưng kiếm thánh vẻ mặt nghiêm túc."),g("br"),g("br"),n._v("Cùng Lạc gia làm bạn nhiều năm, biết thực lực của đối phương cùng át chủ bài, phong cấm chân giải, tại toàn bộ đại lục, đều được cho đỉnh phong nhất, nhi tử tuy là cùng cấp bậc vô địch, chiến lực có một không hai, nhưng gặp phải loại thực lực này cường giả, muốn thắng được, chỉ sợ cũng không dễ dàng như vậy."),g("br"),g("br"),n._v("“Lạc gia bị trước mặt mọi người từ hôn, hao tổn một lần mặt mũi, lần này còn có thể tới, khẳng định có chỗ ỷ lại! Vị này Lạc Thiên Nhai, trước đó chưa từng nghe qua tên, nhưng... Nghe nói cùng cấp bậc bên dưới, đánh bại Chư Tử bách gia cường giả!”"),g("br"),g("br"),n._v("Trước đó nói chuyện trưởng lão, vẻ mặt nghiêm túc."),g("br"),g("br"),n._v("“Đánh bại Chư Tử bách gia cường giả? Bọn họ hiện thân?”"),g("br"),g("br"),n._v("Mộng kiếm thánh cũng không biết tin tức này, nhíu nhíu mày."),g("br"),g("br"),n._v("“Ừm, bọn họ hiện thân Lạc gia, không người có thể địch, vị này Lạc Thiên Nhai bỗng dưng mà ra, cùng cấp bậc đem hắn đánh bại không nói, huyết mạch càng là đạt đến ‘Chín’, một lần đặt vững gia tộc đệ nhất nhân địa vị, lúc này bị xác lập vì tộc trưởng!” Vị trưởng lão này nói."),g("br"),g("br"),n._v("Trương, Lạc hai nhà, trước đó giao hảo, lẫn nhau đều có tin tức nguồn gốc."),g("br"),g("br"),n._v("Lại thêm, Lạc gia cũng không có tận lực giấu diếm, cho nên, mặc dù mới quá khứ hơn hai ngày chút, chịu trách nhiệm thám thính tin tức trưởng lão, đã biết."),g("br"),g("br"),n._v("“Chư Tử bách gia, đến Khổng sư truyền thừa, cùng cấp bậc không nói vô địch, liền xem như chiến sư, muốn thắng được cũng khó khăn! Vị này Lạc Thiên Nhai, có thể nhẹ nhõm đánh bại, thực lực quả thực không thể khinh thường...”"),g("br"),g("br"),n._v("Nghe xong giải thích, Mộng kiếm thánh trong mắt tràn đầy lo lắng."),g("br"),g("br"),n._v("“Cái kia...”"),g("br"),g("br"),n._v("Gãi đầu một cái, Trương Huyền mặt mũi bất đắc dĩ: “Nếu như ta nói... Lạc Thiên Nhai là ta? Các ngươi tin sao?”"),g("br"),g("br"),n._v("“Đừng nghịch, đối phương nắm giữ Lạc gia tinh thuần nhất huyết mạch, làm sao có thể là ngươi!”"),g("br"),g("br"),n._v("Mộng kiếm thánh lắc đầu."),g("br"),g("br"),n._v("Con trai của nàng nắm giữ huyết mạch của nàng, trước đó liền nghiệm chứng qua, Lạc Thiên Nhai có thể lên làm gia chủ, hơn nữa nghiệm chứng huyết mạch, tuyệt đối hai người, không thể nói làm một."),g("br"),g("br"),n._v("“Cái này...”"),g("br"),g("br"),n._v("Một mặt im lặng, nói thế nào nói thật, ngược lại không ai tin?"),g("br"),g("br"),n._v("Trương Huyền đang muốn giải thích một chút, liền nghe đến trên không một hồi tiếng gió gào thét, ngay sau đó một cái lang lãng thanh âm, phá không mà lên."),g("br"),g("br"),n._v("“Chư Tử bách gia Đại Nho đường, Nam Cung Nguyên Phong, Đạm Đài Chấn Thanh, mang theo vãn bối, đến đây viếng thăm Trương gia gia chủ!”"),g("br"),n._v("“Bọn họ sao lại tới đây, tổn thương dưỡng tốt?”"),g("br"),g("br"),n._v("Trương Huyền sững sờ, vội vàng đi ra ngoài điện, mọi người khác cũng đồng loạt theo sau."),g("br"),g("br"),n._v("Ngẩng đầu hướng trên không nhìn lại, ngay sau đó nhìn thấy trước đó Nam Cung Nguyên Phong lơ lửng ở trên không, bên cạnh hắn là cái có chút hơi béo, dáng người to mập, hơn nữa dung mạo xấu xí trung niên nhân, đằng sau thì là một đám đệ tử, trọn vẹn đạt đến tám vị."),g("br"),g("br"),n._v("“Đạm Đài Chấn Thanh? Chẳng lẽ là Tử Vũ Cổ Thánh hậu nhân?”"),g("br"),g("br"),n._v("Trương Huyền lông mày nhíu một cái."),g("br"),g("br"),n._v("Tử Vũ Cổ Thánh, họ kép Đạm Đài, trong truyền thuyết tướng mạo cũng không anh tuấn, Khổng sư từng nói “Trông mặt mà bắt hình dong, thất chi Tử Vũ!” Như vậy lời nói, không nghĩ tới hậu nhân, cũng là như vậy."),g("br"),g("br"),n._v("Trong lòng nghi ngờ, nhìn kỹ hướng mấy người, thời khắc này Nam Cung Nguyên Phong, khuôn mặt hơi trắng bệch, hắn bốn cái đệ tử, Nam Cung Mạt đám người, cũng có chút ốm yếu, thương thế xem ra cũng không khỏi hẳn."),g("br"),g("br"),n._v("“Không đúng, ta tuy là một quyền đem hắn đánh bay, nhưng hẳn là không gây thương tổn được bao nhiêu lợi hại, làm sao cái bộ dáng này?”"),g("br"),g("br"),n._v("Trương Huyền tràn đầy nghi ngờ."),g("br"),g("br"),n._v("Cùng đối phương tỷ thí thời điểm, cũng không mượn nhờ Khổng sư chi huyết, mặc dù toàn lực một quyền, để Nam Cung Nguyên Phong nhận lấy nhất định tổn thương, nhưng mở ra tu vi phong ấn, liền không sao."),g("br"),g("br"),n._v("Làm sao giờ phút này thoạt nhìn, vị này Nam Cung Nguyên Phong, cũng thương thế không nhẹ?"),g("br"),g("br"),n._v("“Tại hạ Trương gia gia chủ Trương Huyền, cung nghênh mấy vị, còn xin xuống một lần!”"),g("br"),g("br"),n._v("Biết lúc này không phải xoắn xuýt lúc này, Trương Huyền ôm quyền, cất cao giọng nói."),g("br"),g("br"),n._v("“Tốt!”"),g("br"),g("br"),n._v("Thấy hắn lễ tiết mười phần, Nam Cung Nguyên Phong mấy người cũng không nói nhiều, thân thể vụt qua, từ không trung bay xuống."),g("br"),g("br"),n._v("“Mời vào bên trong!”"),g("br"),g("br"),n._v("Trương Huyền mỉm cười, đi đầu đi vào đại điện."),g("br"),g("br"),n._v("Phân chủ khách ngồi vào chỗ, Nam Cung Nguyên Phong mở miệng: “Vì phòng ngừa xuất hiện phiền phức, lão phu liền trực tiếp nói rõ mục đích đến đi! Khổng miếu mở ra, ta Chư Tử bách gia, cũng muốn tiến vào bên trong, chiêm ngưỡng thoáng cái tiên thánh lưu lại di tích, nghe nói Trương gia nắm giữ một cái năm đó lưu lại truyền thế thiên phù, không biết có thể bỏ những thứ yêu thích? Chỉ cần các ngươi nguyện ý lấy ra, chúng ta chắc chắn sẽ không bạc đãi, nguyện ý lấy ngang nhau giá cả bảo vật cấp cho hối đoái!”"),g("br"),g("br"),n._v("“Muốn truyền thế thiên phù? Tuyệt đối không thể, ta Trương gia, cũng muốn đi vào Khổng miếu, cái này không có bất kỳ cái gì thảo luận chỗ trống!”"),g("br"),g("br"),n._v("Nghe được yêu cầu của hắn, Hưng kiếm thánh sầm mặt lại."),g("br"),g("br"),n._v("Còn tưởng rằng muốn làm gì, không nghĩ tới là cái này."),g("br"),g("br"),n._v("Khổng miếu là Khổng sư năm đó lưu lại bảo tàng lớn nhất, một khi bỏ lỡ cơ hội, chẳng khác nào từ bỏ mạnh mẽ địa vị... Trương gia có truyền thế thiên phù, loại này Tiên Thiên ưu thế, làm sao có thể chắp tay nhường cho người?"),g("br"),g("br"),n._v("Dù là đối phương là Chư Tử bách gia, cũng sẽ không đồng ý!"),g("br"),g("br"),n._v("“Đã như vậy, vậy liền thực lực xem hư thực! Khổng sư tùy theo tài năng tới đâu mà dạy, cổ vũ học sinh ở giữa cạnh tranh với nhau, truyền thế thiên phù đã vì hắn lưu lại, tự nhiên cũng hi vọng cường giả nắm giữ, mới có thể khi tiến vào Khổng miếu về sau, có chỗ đến, có việc nên làm!”"),g("br"),g("br"),n._v("Nam Cung Nguyên Phong dường như sớm biết sẽ bị cự tuyệt, ngẩng đầu nhìn tới: “Đã như vậy, chúng ta khiêu chiến các ngươi Trương gia, đối thời gian lĩnh ngộ, nếu như các ngươi trăm tuổi trở xuống vãn bối, có thể tại thời gian lĩnh ngộ bên trên thắng được chúng ta hậu bối, truyền thế thiên phù sự tình như vậy coi như thôi, ta Chư Tử bách gia, nguyện ý lấy một cái Cổ Thánh đã dùng qua bảo vật, nói xin lỗi! Hóa giải hôm nay đường đột. Nếu như, các ngươi thua, mong rằng có thể đem truyền thế thiên phù giao cho chúng ta đảm bảo!”"),g("br"),g("br"),n._v("“Khiêu chiến Trương gia đối thời gian lĩnh ngộ? Ngươi những đệ tử này?” Trương Huyền cau mày."),g("br"),g("br"),n._v("“Tự nhiên không phải, là Đạm Đài huynh học sinh, đối với các ngươi tiến hành khiêu chiến!”"),g("br"),g("br"),n._v("Nam Cung Nguyên Phong cười cười."),g("br"),g("br"),n._v("(Ban ngày tiểu công chúa sinh nhật, không có thời gian viết, chỉ có hai chương, ban ngày còn có, các vị, có nguyệt phiếu tiếp tục ném ah! Lão nhai cảm tạ!)"),g("br"),g("br"),n._v("Người đăng: ThấtDạ"),g("br"),g("br"),g("br"),g("br")]),n._v(" "),g("hr"),n._v(" "),g("p",[g("a",{attrs:{href:"./chap-1640"}},[n._v("Chương trước")]),n._v("  |  "),g("a",{attrs:{href:"./chap-1642"}},[n._v("Chương sau")])])])}),[],!1,null,null,null);h.default=t.exports}}]);